%[text] %[text:anchor:T_B948BEBD] # **Implied Volatility Chart Examples**
%[text] **Overview**
%[text] The `ImpliedVolatilityChart` creates a smooth, interpolated implied volatility surface for the observed option data $(T, K, \\sigma, S)$, where
%[text] - $T$ is the expiry time of the option, measured in years;
%[text] - $K$ is the strike price of the option, in currency units (e.g., USD or GBP);
%[text] - $\\sigma$ is the implied volatility, recorded as a decimal value in \[0, 1\];
%[text] - $S$ is the underlying asset price, in currency units. \
%[text] The chart data comprises a table (`OptionData`) containing four numeric vector variables, namely $T$, $K$, $\\sigma$ and $S$ in that order. The observed option data is overlaid on the implied volatility surface for reference. The interpolation method for each volatility curve, or *smile*, is one of `linear`, `spline`, `pchip` (the default), `makima`, `Hagan2002` and `Obloj2008`. The first four methods are non-parametric, and implemented using the `interp1` function. The latter two are variants of the SABR model for computing the implied Black volatility, and are implemented using the `blackvolbysabr` function. In this case the SABR model is calibrated using nonlinear least squares (`lsqnonlin`).
%[text] ![ImpliedVolatilityChart.png](text:image:2493)
%[text] **Documentation**
%[text] - [`interp1`](<matlab: doc("interp1")>): performs 1-D data interpolation
%[text] - [`blackvolbysabr`](<matlab: doc("blackvolbysabr")>): calculates the implied Black volatility using the SABR model
%[text] - [`lsqnonlin`](<matlab: doc("lsqnonlin")>): solves nonlinear least-squares (nonlinear data-fitting) problems \
%[text:tableOfContents]{"heading":"Table of Contents"}
%[text] 
%%
%[text] %[text:anchor:H_0EF8A30C] ## Load the observed market data.
%[text] The market data comprises option expiry times, strike prices and implied volatilities. The times to expiry are divided into different bins, indicated by the variable `Group`. Volatility smiles corresponding to the times in each bin have similar shapes.
load( fullfile( chartsRoot(), "data", "Option.mat" ), "D" )
%%
%[text] %[text:anchor:H_967E0FE5] ## Create a figure for the chart.
f = exampleFigure( "Name", "ImpliedVolatilityChart Example" ); %[output:747c4f91]
%%
%[text] %[text:anchor:H_D719D672] ## Create the chart.
%[text] First, extract the option data for a specific group.
D1 = D(D.Group == "G1", 1:4);
IVC = ImpliedVolatilityChart( "Parent", f, ... %[output:group:86f13874] %[output:747c4f91]
    "OptionData", D1 ); %[output:group:86f13874] %[output:747c4f91]
%%
%[text] %[text:anchor:H_F5F036EE] ## Annotate the chart.
xlabel( IVC, "Time to expiry (years)", "FontSize", 14 ) %[output:2053c0c2]
ylabel( IVC, "Strike price ($)", "FontSize", 14 ) %[output:2053c0c2]
zlabel( IVC, "Volatility", "FontSize", 14 ) %[output:2053c0c2]
title( IVC, "ImpliedVolatility Chart", "FontSize", 16 ) %[output:2053c0c2]
%[text] Add a colorbar.
colorbar( IVC ) %[output:2053c0c2]
%%
%[text] %[text:anchor:H_807F580C] ## Create a custom colormap and apply it to the chart.
colormap( IVC, money() ) %[output:2b985817]
%%
%[text] %[text:anchor:H_DE1FD5A8] ## Restrict the strike prices to lie between $60 and $100.
newData = D1(D1.StrikePrice >= 60 & D1.StrikePrice <= 100, :);
IVC.OptionData = newData; %[output:7972b2ee]
%%
%[text] %[text:anchor:H_EB884684] ## Remove the first expiry time from the surface.
newData = D1(D1.ExpiryTime > D1.ExpiryTime(1), :);
IVC.OptionData = newData; %[output:9acf95c4]
%%
%[text] %[text:anchor:H_80DE664A] ## Create multiple charts using a grid.
%[text] First, create a grid to hold the multiple charts.
f = exampleFigure(); %[output:34081879]
g = uigridlayout( f, [2, 2] ); %[output:34081879]
%[text] Loop through the groups, creating a new chart for each group.
numGroups = 4;
chartsByGroup = cell( 1, numGroups );
for k = 1 : numGroups %[output:group:31bd6bb1]
    groupIdx = "G" + k;
    chartsByGroup{k} = impVolChart( D, groupIdx, g ); %[output:34081879]
end % for %[output:group:31bd6bb1]
%%
%[text] %[text:anchor:H_EE1EB549] ## Change the surface interpolation method for a specific chart.
chartsByGroup{2}.InterpolationMethod = "makima"; %[output:1defe678]
%%
%[text] %[text:anchor:H_57BAAE78] ## Customize the appearance of a specific chart.
set( chartsByGroup{3}, "Marker", "square", ... %[output:group:13b6fc54] %[output:53662f1b]
    "MarkerSize", 4, ... %[output:53662f1b]
    "MarkerFaceColor", "m", ... %[output:53662f1b]
    "MarkerEdgeColor", "k" ) %[output:group:13b6fc54] %[output:53662f1b]
%%
%[text] %[text:anchor:H_6DA7C8BE] ## Local functions.
%[text] %[text:anchor:H_9E3D5F61] ### Define a custom colormap for use with the implied volatility chart.
function cmap = money()

t = linspace( 0, 1, 256 ).';
cmap = [t, flip( t ), zeros( size( t ) )];

end % money
%[text] %[text:anchor:H_51A04E15] ### Create an implied volatility chart for a given group.
function IVC = impVolChart( D, groupID, parent )

% Extract the option data for the given group.
currentGroupOptionData = D(D.Group == groupID, 1:4);

% Create the chart.
IVC = ImpliedVolatilityChart( "Parent", parent, ...
    "OptionData", currentGroupOptionData );

% Annotate and customize the chart.
xlabel( IVC, "Time to expiry (years)" )
ylabel( IVC, "Strike price ($)" )
zlabel( IVC, "Volatility" )
title( IVC, "ImpliedVolatility Chart, Group " + groupID )
colormap( IVC, money() )

end % impVolChart
